import React from 'react';
import OneTimeUseImage from './images/one-time-use.jpg';

const OneTimeUseSolutions = () => {
  return (
    <div className="one-time-use-solutions">
      <img src={OneTimeUseImage} alt="One-Time Use Solutions" />
      <div className="details">
        <h2>One-Time Use Solutions</h2>
        <p>Customized services for specific business needs.</p>
      </div>
    </div>
  );
};

export default OneTimeUseSolutions;
